package p33xx

import util.expect
import kotlin.math.absoluteValue
import kotlin.math.sign

fun main() {
    class Solution {
        val m = 1000000007

        operator fun Array<LongArray>.times(t: Array<LongArray>): Array<LongArray> {
            val result = Array(26) { LongArray(26) }
            repeat(26) { i ->
                repeat(26) { j ->
                    repeat(26) { k ->
                        result[i][j] = (result[i][j] + this[i][k] * t[k][j]) % m
                    }
                }
            }
            return result
        }

        private fun quickMul(mat: Array<LongArray>, times: Int): Array<LongArray> {
            var t = times
            var ans = Array(26) { i ->
                LongArray(26) { j ->
                    1L - (i - j).sign.absoluteValue
                }
            }
            var cur = mat
            while (t > 0) {
                if ((t and 1) == 1) {
                    ans = ans * cur
                }
                cur = cur * cur
                t = t shr 1
            }
            return ans
        }

        fun lengthAfterTransformations(s: String, t: Int, nums: List<Int>): Int {
            val matrix = Array(26) { LongArray(26) }
            repeat(26) { i ->
                for (offset in 1..nums[i]) {
                    matrix[(i + offset) % 26][i] = 1
                }
            }

            val mul = quickMul(matrix, t)
            val counts = IntArray(26)
            s.forEach {
                counts[it - 'a']++
            }

            var result = 0L
            repeat(26) { i ->
                repeat(26) { j ->
                    result = (result + mul[i][j] * counts[j]) % m
                }
            }
            return result.toInt()
        }
    }

    expect {
        Solution().lengthAfterTransformations(
            "",
            492153482,
            listOf(23, 20, 4, 11, 4, 24, 13, 25, 12, 21, 17, 7, 6, 21, 12, 11, 22, 25, 22, 16, 19, 8, 16, 18, 19, 16)
        )
    }
}
